import Link from 'next/link';

const Index = () => (
  <div>
    <Link href="/about">
      <a title="About Page">About Page</a>
    </Link>
    <Link href="/about">
      <button>Go to about page</button>
    </Link>
    <p>Hello Next.js</p>
  </div>
);

export default Index;
